import { Link } from 'react-router-dom';
import './ContentBox.css';

function ContentBox({ repoName, boxUrl }) {
  return (
    <div className="content-box">
      <h2>{repoName}</h2>
      {/* Usamos Link para la navegaci√≥n interna y `to` como un objeto para pasar estado si es necesario */}
      <Link to={`/topics/${encodeURIComponent(repoName)}`}>Abrir el video</Link>
    </div>
  );
}

export default ContentBox;
